  //code for graph here

  if(symbolToGraph.length > 0)
    return (
      <div className='card mb-1 center'>
        <p><span className='text-warning'>({symbolToGraph}) </span></p>
      </div>
    )
  else
    return (<>{console.log("o no")}</>)
}
